en.what_is_annotation = 'This box shows the currently selected peak and allows to answer to simple questions. If you think that the peak is not valid you can proceed to the next one. If instead you think that the peak is valid, you will be asked to insert its ufficial name and elevation, if you don’t know you can ignore them. In every case you must save your answers by pressing the “Save” button.';
it.what_is_annotation = 'Questa sezione mostra il picco correntemente selezionato e ti permette di rispondere a delle semplici domande. Se ritieni che il picco non sia valido puoi procedere a quello sucessivo. Se invece ritieni che il picco sia valido, ti verrà chiesto di inserire il suo nome e altezza ufficiali, se non li conosci puoi ignorarli. In tutti i casi devi salvare le tue risposte premendo il pulsante “Salva”.';
en.what_is_map = 'This view allows you to visualize the position of the selected peak. The tridimensional map is interactive, if you disable the rotation mode, and you can use the mouse or the arrows keys to change the point of view. If you prefer, a bidimensional map with contour lines is available by clicking the button in the bottom left.';
it.what_is_map = 'Questa vista ti permette di visualizzare la posizione del picco selezionato. La mappa tridimensionale è interattiva (se esci dalla modalita rotazione) e puoi usare il mouse o le frecce sulla tastiera per cambiare la visuale. Se preferisci, è disponibile una cartina bidimensionale con le curve di livello apribile cliccando sul pulsante in basso a sinistra. ';
en.what_is_mmm = 'Map My Mountains is a crowdsourcing tool that visualizes peaks that have been found by automatically analyzing digital elevation models (DEM) of the terrain. The aim of this tool is to allow a user to visualize each of the found peaks and verify whether they could be really considered peaks or not.';
it.what_is_mmm = 'Map My Mountains è uno strumento di crowdsourcing che visualizza picchi che sono stati trovati in modo automatico analizzando il modello digitale del terreno. Lo scopo di questo strumento è di permettere ad un utente di visualizzare ognuno dei picchi trovati e verificare se possono essere veramente considerati dei picchi.';
en.what_is_peak_list = 'This box provides the list of peaks. The peaks are identified by a progressive ID. Clicking on one of the peaks of the list will center the map view on it and it will be possible to label it as a peak or not.';
